	add("postcode", "{\"term\":\"postcode\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|post|code|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A sequence of letters and numbers added to a postal address to aid the sorting and delivery of post / mail\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The region denoted by a postcode\", \"priority\":2}]}, \"synonyms\":{}}");

	add("postcoitus", "{\"term\":\"postcoitus\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The period immediately after coitu\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Primitive hematopoiesis occurs around day 7.5 \u0027\u0027postcoitus\", \"priority\":2}]}, \"synonyms\":{}}");

	add("postcondition", "{\"term\":\"postcondition\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|post|condition|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A condition that must be met immediately after execution of some piece of code\", \"priority\":1}]}, \"synonyms\":{}}");

	add("postcranium", "{\"term\":\"postcranium\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|post|cranium|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The skeleton posterior to the cranium, or a portion thereof\", \"priority\":1}]}, \"synonyms\":{}}");

	add("postcubitus", "{\"term\":\"postcubitus\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|post|cubitus|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One of the major veins of the insect wing, between the cubitus and the anal veins (although it was originally considered one of the anal veins itself\", \"priority\":1}]}, \"synonyms\":{}}");

	add("postdiction", "{\"term\":\"postdiction\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"In imitation of \u0027prediction\u0027 with the prefix \u0027pre-\u0027 replaced by its antonym \u0027post-\u0027 Category:English words prefixed with post-\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The construction of past conditions by relying on the present\", \"priority\":1}]}, \"synonyms\":{}}");

	add("postdoc", "{\"term\":\"postdoc\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Shortened form of postdoctoral\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A postdoctoral academic research position\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Someone in such a position\", \"priority\":2}]}, \"synonyms\":{}}");

	add("posteriorization", "{\"term\":\"posteriorization\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|posterior|ization|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The acquisition of posterior values, especially the formation of the forebrain, midbrain, hindbrain and spinal cord from the anterior neural plate\", \"priority\":1}]}, \"synonyms\":{}}");

	add("posterity", "{\"term\":\"posterity\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"Late 14th century, from Middle french (ca. 1400-1600) \u0027postérité\u0027 from Latin \u0027posteritas\u0027 from \u0027posterus\u0027 (following, coming after) from \u0027post\u0027 (after) (English \u0027post-\u0027 .\u0026lt;ref\u0026gt;{{R:Online Etymology Dictionary}}\u0026lt;/ref\u0026gt;Displaced Old English words such as \u0027æftercneoreso\u0027 \u0027frumcynn\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"All the future generations, especially the descendants of a specific person\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d1|url\u003dhttp://openlibrary.org/works/OL2004261W|passage\u003dThe original family who had begun to build a palace to rival Nonesuch had died out before they had put up little more than the gateway, so that the actual structure which had come down to \u0027\u0027posterity\u0027\u0027 retained the secret magic of a promise rather than the overpowering splendour of a great architectural achievement\", \"priority\":2}]}, \"synonyms\":{}}");

	add("postern", "{\"term\":\"postern\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027posterne\u0027 alteration of \u0027posterle\u0027 from \u0027posterula\u0027 () from Latin \u0027posterus\u0027 (later)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A back gate, back door, side entrance, or other gateway distinct from the main entrance\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"And as they cam hurlyng vnder the Castel where as sir launcelot lay in wyndowe / \u0026amp; sawe how two knyghtes layd vpon syr Blyaunt with their swerdes // And thenne sir launcelot brake the chaynes fro his legges and of his armes // \u0026amp; so sir launcelot ran out at a \u0027\u0027posterne\u0027\u0027 / and there he mett with the two knyȝtes that chaced sir Blyaunt\u0026lt;!--Prior quote:Sir Launcelot ran oute at a \u0027\u0027posterne\u0027\u0027, and there he mette wyth tho two knyghtes that chaced Syr Blyaunte.--\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"c.1552–1599\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"He by a privy \u0027\u0027postern\u0027\u0027 took his flight\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"c.1564–1616\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Out at the \u0027\u0027postern\u0027\u0027, by the abbey wall\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"By extension, a separate or hidden way in or out of a place, situation etc\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A subterranean passage communicating between the parade and the main ditch, or between the ditches and the interior of the outworks\", \"priority\":8}]}, \"synonyms\":{}}");

	add("postextrasystole", "{\"term\":\"postextrasystole\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|post|extrasystole|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The part of an irregular heartbeat rhythm following an extrasystole\", \"priority\":1}]}, \"synonyms\":{}}");

	add("postfeminism", "{\"term\":\"postfeminism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|post|feminism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of a wide range of theories, some of which argue that feminism is no longer relevant to today\u0027s society or that feminism needs to be extended to fit the changing expectations and experiences of women since feminism\u0027s inception\", \"priority\":1}]}, \"synonyms\":{}}");

	add("postgenderism", "{\"term\":\"postgenderism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|post-|gender|-ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A sociopolitical and cultural movement for the voluntary elimination of gender in the human species through the application of biotechnology\", \"priority\":1}]}, \"synonyms\":{}}");

	add("postgenomics", "{\"term\":\"postgenomics\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of various fields of study that are only possible after the publication of the genome of an organism\", \"priority\":1}]}, \"synonyms\":{}}");

	add("postgraduate", "{\"term\":\"postgraduate\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person continuing to study in a field after having successfully completed a degree course\", \"priority\":1}]}, \"synonyms\":{}}");

	add("postgrunge", "{\"term\":\"postgrunge\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A 1990s subgenre of alternative rock, utilizing the sounds and aesthetic of grunge, but with a more commercially acceptable sound\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, Simon Reynolds, \u0027Generation ecstasy: into the world of techno and rave culture\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Although the \u0026quot;Electronica Revolution\u0026quot; has been hailed in the US media as the long-overdue arrival of techno to America, it\u0027s readily apparent that the British invaders have met the \u0027\u0027postgrunge\u0027\u0027 audience halfway\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Lynn Viehl, \u0027Dark need\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"quot;Aren\u0027t you a little young for that? What happened to grunge and punk?\u0026quot; \u0026quot;It\u0027s \u0027\u0027postgrunge\u0027\u0027 now. I think punk is buried next to disco.\u0026quot\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Barry Mazor, \u0027Meeting Jimmie Rodgers\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A similar impulse lay behind the alternative country idiom that established itself in the mid-\u002790s, with a historical knowingness and \u0027\u0027postgrunge\u0027\u0027 sensibility\", \"priority\":7}]}, \"synonyms\":{}}");

	add("posthegemony", "{\"term\":\"posthegemony\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The theory that hegemony and ideology of discourse can no longer properly reflect the social order. Posthegemony also finds that history is not, as w:Karl Karl Marx described it, a class struggle, but rather a \u0026quot;struggle to produce class\u0026quot;.[http://www.blackwell-synergy.com/doi/abs/10.1111/1470-9856.00067\", \"priority\":1}]}, \"synonyms\":{}}");

	add("posthole", "{\"term\":\"posthole\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|post|hole|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A cut feature used to hold a surface timber or stone, usually much deeper than it is wide\", \"priority\":1}]}, \"synonyms\":{}}");

	add("postiche", "{\"term\":\"postiche\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French {{m|fr|postiche}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any item of false hair worn on the head or face, such as a false beard or wig\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1993\u0027\u0027, Patsy Baker, \u0027Wigs \u0026amp; Makeup for Theatre, Television, and Film\u0027, page 15\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"This type of \u0027\u0027postiche\u0027\u0027 is called a \u0027combination wig\u0027 because it mixes hand-made work with machine-made work\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, Allan Peterkin, \u0027One Thousand Beards: A cultural history of facial hair\u0027, page 1\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"both kings and queens enjoyed wearing lavish fake beards made of gold and silver called \u0027\u0027\u0027postiches\u0027\u0027\u0027, which were strapped behind the ears like a Halloween mask\", \"priority\":5}]}, \"synonyms\":{}}");

	add("postie", "{\"term\":\"postie\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"British colloquial\u0027) Postman\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Has the \u0027\u0027postie\u0027\u0027 been yet\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Thank you, \u0027\u0027postie\", \"priority\":3}]}, \"synonyms\":{}}");

	add("postilion", "{\"term\":\"postilion\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Italian\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027postillon\u0027 and its likely source, Italian \u0027postiglione\u0027 (guide for driver of post-coach) from \u0027posta\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A rider mounted on the near (left) leading horse who guides the team pulling a carriage\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A post-boy, a messenger boy, a swift letter carrier\", \"priority\":2}]}, \"synonyms\":{}}");

	add("posting", "{\"term\":\"posting\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"action of the verb \u0027to post\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"an item inserted into a register, ledger or diar\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"an entry in a computerized bulletin boar\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"an entry in a blo\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"the place where a soldier or airman is sent (posted) for duty; the time spent there\", \"priority\":5}]}, \"synonyms\":{}}");

	add("postlude", "{\"term\":\"postlude\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"From \u0027\u0027 + Latin \u0027ludus\u0027 (play) (modelled on \u0027\u0027 .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The final part of a piece; especially music played (normally on the organ) at the end of a church service\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A concluding passage of text or speech; an epilogue or afterword\", \"priority\":2}]}, \"synonyms\":{}}");

	add("postman", "{\"term\":\"postman\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|post|man|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"someone (implied male) who delivers the post (mail) to, and/or collects the post from, residential or commercial addresses, or from public mailboxes\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"One of the two most experienced barristers in the Court of Exchequer, who have precedence in motions, so called from the place where he sits, the other of the two being the tubman\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"James Whishaw, \u0027A Synopsis of the Members of the English Bar\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Postman\u0027\u0027 of the Court of Exchequer\", \"priority\":4}]}, \"synonyms\":{}}");

	add("postmark", "{\"term\":\"postmark\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Image:Squared-circle_postmark_1890.jpg|thumb|right|A postmark from 1890.Compound of post + mark.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A marking made by a postal service on a letter, package, postcard or the like, usually indicating the place where and the date and time when the item was received or processed for the first time, and often serving to cancel a postage stamp\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1920\u0027\u0027, \u0027Bulldog Drummond\u0027 Chapter\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"He looked at the mauve envelope doubtfully, and examined the \u0027\u0027postmark\u0027\u0027. \u0026quot;Where is Pudlington, James? and one might almost ask—why is Pudlington? No town has any right to such an offensive name.\u0026quot\", \"priority\":3}]}, \"synonyms\":{}}");

	add("postmaterialism", "{\"term\":\"postmaterialism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The transformation of individual values from materialist, physical and economic to those of autonomy and self-expression\", \"priority\":1}]}, \"synonyms\":{}}");

	add("postmaturity", "{\"term\":\"postmaturity\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|post|maturity|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The condition of a baby that has not yet been born after 42 weeks of gestation, two weeks beyond the normal 40\", \"priority\":1}]}, \"synonyms\":{}}");

	add("postmillennialism", "{\"term\":\"postmillennialism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|postmillennial|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An interpretation of the Book of Revelation where Christ\u0027s second coming will be after the \u0026quot;Millennium\u0026quot;, a Golden Age or era of prosperity and dominance of the Christianity\", \"priority\":1}]}, \"synonyms\":{}}");

	add("postminimalism", "{\"term\":\"postminimalism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|post|minimalism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of various artistic movements that seek to move beyond the restrictions of minimalis\", \"priority\":1}]}, \"synonyms\":{}}");

	add("postmix", "{\"term\":\"postmix\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|post|mix|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A soft drink concentrate that is delivered to a retailer to be mixed to order for customers\", \"priority\":1}]}, \"synonyms\":{}}");

	add("postmodernism", "{\"term\":\"postmodernism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{prefix|post|modernism|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any style in art, architecture, literature, philosophy, etc., that reacts against an earlier modernist movement\", \"priority\":1}]}, \"synonyms\":{}}");

	add("postmodifier", "{\"term\":\"postmodifier\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|post|modifier|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A modifier placed after the head of the phrase\", \"priority\":1}]}, \"synonyms\":{}}");

	add("postphenomenology", "{\"term\":\"postphenomenology\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|post|phenomenology|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A revised form of phenomenology that aims to overcome the limitations of subjectivism\", \"priority\":1}]}, \"synonyms\":{}}");

	add("postposition", "{\"term\":\"postposition\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|post|position|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of various words in languages such as German, Hindi, Japanese and Finno-Ugric languages (Estonian, Finnish and Hungarian) that have the same purpose as a preposition but come \u0027after\u0027 the noun\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The act of placing after, or the state of being placed after\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"the \u0027\u0027postposition\u0027\u0027 of the nominative case to the verb\", \"priority\":3}]}, \"synonyms\":{}}");

	add("postpositivism", "{\"term\":\"postpositivism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|post|positivism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A metatheoretical stance that critiques and amends positivism. While positivists believe that the researcher and the researched person are independent of each other, postpositivists accept that theories, background, knowledge and values of the researcher can influence what is observed. They believe that human knowledge is based not on unchallengeable, rock-solid foundations, but rather upon human conjectures\", \"priority\":1}]}, \"synonyms\":{}}");

	add("postremogeniture", "{\"term\":\"postremogeniture\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"First attested in 1865; \u0027\u0027either\u0027\u0027 Latin \u0027postrēmōgenitus\u0027 (last-born) + English \u0027-ure\u0027 \u0027\u0027or\u0027\u0027 the compounding in English of the Latin \u0027postrēmus\u0027 ([person who is] last) + \u0027genitūra\u0027 in \u0027\u0027both\u0027\u0027 cases after \u0027primogeniture\u0027 compare \u0027postreme\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"by the last- of the of, or of a position in, a ’s , or\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1865\u0027\u0027, “Revue Historique de droit Français et Étranger” in \u0027The Journal of Jurisprudence\u0027 IX, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003db69GAQAAIAAJ\u0026amp;pg\u003dPA47\u0026amp;dq\u003d%22postremogeniture%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dXs9HT--OOMzf8QPtm_3ADg\u0026amp;ved\u003d0CDoQ6AEwA\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22postremogeniture%22\u0026amp;f\u003dfalse page 47]\u0026lt;/span\u0026gt\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The general rule of the equal partition of property, without distinction of sex or primogeniture, suffers exception in the law of \u0027juveigneurie\u0027, or, as it may be called, \u0027\u0027postremogeniture\u0027\u0027, which confers, not on the eldest of children, but on the youngest, the paternal mansion\", \"priority\":4}]}, \"synonyms\":{}}");

	add("postretiree", "{\"term\":\"postretiree\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|post|retiree|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A retiree, especially one who has retired later than the normal retirement age\", \"priority\":1}]}, \"synonyms\":{}}");

	add("postrider", "{\"term\":\"postrider\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|post|rider|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who rides over a postroad to carry the mails\", \"priority\":1}]}, \"synonyms\":{}}");

	add("postscriptum", "{\"term\":\"postscriptum\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027postscriptum\u0027 from \u0027post\u0027 (after, behind) + \u0027scrīptum\u0027 (text; something written)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A thing which has been) written afterwards, appended\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1827\u0027\u0027, M. Corbett, \u0027The odd volume\u0027, containing a letter purporting to be from King James VI of Scotland to Sandie Fotheringhame, Laird o\u0027Powrie, signed: James, R\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Postscriptum\u0027\u0027. — Scotland for ever! The Dane’s beneath the table, and Rab’s on the tap o’t, blawing like the deevil\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1900\u0027\u0027, Honoré de Balzac, Anatole Cerfberr, \u0027La Comédie Humaine: Now for the First Time Completely Translated Into English\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"This confidence so daintily tossed to the baron, in the fashion of a \u0027\u0027postscriptum\u0027\u0027, was evidently the compensation for five thousand francs\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, L. G. Aslamazov, A. A. Varlamov, \u0027The Wonders Of Physics\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Postscriptum\u0027\u0027 for taxpayers: After having started with the high-temperature thriller we turned to applications of conventional superconductors\", \"priority\":7}]}, \"synonyms\":{}}");

	add("postscutellum", "{\"term\":\"postscutellum\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|post|scutellum|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The hindmost dorsal piece of a thoracic somite of an insect; the plate behind the scutellum\", \"priority\":1}]}, \"synonyms\":{}}");

	add("poststructuralism", "{\"term\":\"poststructuralism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|post|structuralism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An extension of structuralism influenced by the deconstructionists\", \"priority\":1}]}, \"synonyms\":{}}");

	add("posttourism", "{\"term\":\"posttourism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|post|tourism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A postmodern form of tourism in which the tourist is aware of the artificial nature of the experience but nevertheless able to enjoy it\", \"priority\":1}]}, \"synonyms\":{}}");

	add("postulata", "{\"term\":\"postulata\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1798\u0027\u0027: the w:Thomas Robert Rev. Thomas Robert Malthus FRS, \u0027w:An Essay on the Principle of An Essay on the Principle of Population\u0027, chapter\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"I think I may fairly make two \u0027\u0027postulata\u0027\u0027. First, That food is necessary to the existence of man. Secondly, That the passion between the sexes is necessary and will remain nearly in its present state. These two laws, ever since we have had any knowledge of mankind, appear to have been fixed laws of our nature, and, as we have not hitherto seen any alteration in them, we have no right to conclude that they will ever cease to be what they now are, without an immediate act of power in that Being who first arranged the system of the universe, and for the advantage of his creatures, still executes, according to fixed laws, all its various operations. […] Assuming then my \u0027\u0027postulata\u0027\u0027 as granted, I say, that the power of population is indefinitely greater than the power in the earth to produce subsistence for man. Population, when unchecked, increases in a geometrical ratio\", \"priority\":2}]}, \"synonyms\":{}}");

	add("postulate", "{\"term\":\"postulate\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"{{attention|la}} {{m|la|postulātus|postulāt-|asked}}, from the verb {{m|la|postulāre||to ask}}, from Latin {{m|la|postulō||request}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Something assumed without proof as being self-evident or generally accepted, especially when used as a basis for an argument\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A fundamental element; a basic principle\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An axiom\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A requirement; a prerequisite\", \"priority\":4}]}, \"synonyms\":{}}");

	add("posture", "{\"term\":\"posture\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Italian\", \"Latin\"], \"text\":\"From French from Italian {{m|it|postura}}, from Latin {{m|la|positūra||position, situation}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The way a person holds and positions their body\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1609,\u0027\u0027 William Shakespeare, \u0027Coriolanus\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"As if that whatsoever god who leads him / Were slily crept into his human powers, / And gave him graceful \u0027\u0027posture\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1689\u0027\u0027 (or earlier), Aphra Behn, \u0027Love-Letters Between a Nobleman and His Sister\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"walking in a most dejected \u0027\u0027posture\u0027\u0027, without a band, unbraced, his arms a-cross his open breast, and his eyes bent to the floor\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1895,\u0027\u0027 Oscar Wilde, \u0027The Importance of Being Earnest\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Rise, sir, from this semi-recumbent \u0027\u0027posture\u0027\u0027. It is most indecorous\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A situation or condition\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1905,\u0027\u0027 David Graham Phillips, \u0027The Deluge\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Even as I was reading these fables of my millions, there lay on the desk before me a statement of the exact \u0027\u0027posture\u0027\u0027 of my affairs\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"1910,\u0027\u0027 H.G. Wells, \u0027The History of Mr Polly\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Uncle Jim stopped amazed. His brain did not instantly rise to the new \u0027\u0027posture\u0027\u0027 of things\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"One\u0027s attitude or the social or political position one takes towards an issue or another person\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"1651,\u0027\u0027 Thomas Hobbes, \u0027Leviathan\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"that is, their Forts, Garrisons, and Guns upon the Frontiers of their Kingdomes; and continuall Spyes upon their neighbours; which is a \u0027\u0027posture\u0027\u0027 of War\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"1912,\u0027\u0027 G.K. Chesterton, \u0027A Miscellany of Men\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"But it is not true, no sane person can call it true, that man as a whole in his general attitude towards the world, in his \u0027\u0027posture\u0027\u0027 towards death or green fields, towards the weather or the baby, will be wise to cultivate dissatisfaction\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"The position of someone or something relative to another; position; situation\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"1661,\u0027\u0027 Thomas Salusbury (translator), \u0027Galileo\u0027s Dialogue Concerning the Two Chief Systems of the World\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"The Moon beheld in any \u0027\u0027posture\u0027\u0027, in respect of the Sun and us, sheweth us its superficies ... always equally clear\", \"priority\":20}]}, \"synonyms\":{}}");

	add("postvisualization", "{\"term\":\"postvisualization\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|post|visualization|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Manipulation of recorded footage in order to change the way a scene is presented\", \"priority\":1}]}, \"synonyms\":{}}");

	add("postwork", "{\"term\":\"postwork\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|post|work|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Postproduction, work on filmed material after principal photography, as to improve image quality or synchronize sound\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Work on images after work in the field or set or after non-digital phases of image creation\", \"priority\":2}]}, \"synonyms\":{}}");

